// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract ActualBank{
    uint minAccountBalance=1 ether;
    address owner;
    mapping( address => uint256) balance;
    mapping(address => uint256) secretKey;

    constructor(){

    }

    function openAccount(uint256 _amount,uint256 _secretKey) payable public returns(uint256) {
        require(msg.value >= minAccountBalance,"There must a minimum balance of 1 ether");
        require(msg.value == _amount,"Values are not correct");
        balance[msg.sender]+=_amount;
        secretKey[msg.sender]=_secretKey;
        return balance[msg.sender];
    }


    function deposit(address benificiaryAccount,uint256 _amount) payable public returns(uint256){
        require(msg.value == _amount);
        require(balance[benificiaryAccount] != 0);
        balance[benificiaryAccount]+=_amount;
        return balance[benificiaryAccount];
    }

    function withDraw(uint256 _amount, uint256 _secretKey) payable public returns(uint256) {
        require(msg.value <= address(this).balance, "With drawal value not correct");
        require(msg.value == _amount, " Arguments not correct");
        require(secretKey[msg.sender] == _secretKey, "Secret key didn't matched");
        balance[msg.sender]-=_amount;
        payable(msg.sender).transfer(_amount);
        return balance[msg.sender];
    }
    function getTotalBankBalance() public returns(int){

    }
}

